  render() {


    return (
      <div style={{ backgroundColor: "black", width: "100vw", height: 52 }}>

        <div style={{ backgroundCsolor: "blue", width: 40, height: 40 }}>
          <img src={logo} style={{width: "100%", height: "100%" }}/>
        </div>

      </div>
    );
  }
}

export default NavBar;
